<script>
    /*
        A JavaScript Set is a collection of unique values. Each value can only occur once in a Set.
    */ 

    let ip1 = new Set(["Rajkot", "Baroda", "Ahamdabad", "Surat", "Bhuj", "Jamnagar", "Rajkot"]);

    for(let x of ip1){
        document.write(" "+x);
    }
</script>
